   "source": [
    "# 2. Фильтрация и расчет возраста (Используем твои названия колонок!)\n",
    "gas_reactors <- df %>%\n",
    "  # Ищем в колонке 'ReactorModel' или 'ReactorType'\n",
    "  filter(\n",
    "    str_detect(ReactorModel, regex(\"Gas|GCR|AGR|HTGR|Magnox\", ignore_case = TRUE)) |\n",
    "    str_detect(ReactorType, regex(\"Gas|GCR|AGR|HTGR|Magnox\", ignore_case = TRUE))\n",
    "  ) %>%\n",
    "  \n",
    "  mutate(\n",
    "    # Работаем с датами\n",
    "    OperationalFrom = as.Date(OperationalFrom),\n",
    "    ConstructionStartAt = as.Date(ConstructionStartAt),\n",
    "    \n",
    "    # Считаем дату старта (если нет OperationalFrom, берем ConstructionStartAt)\n",
    "    start_date = coalesce(OperationalFrom, ConstructionStartAt),\n",
    "    \n",
    "    # Возраст\n",
    "    age = as.numeric(difftime(Sys.Date(), start_date, units = \"days\")) / 365.25\n",
    "  ) %>%\n",
    "  \n",
    "  # Убираем тех, у кого возраст не посчитался\n",
    "  filter(!is.na(age))\n",
    "\n",
    "# 3. Визуализация\n",
    "leaflet(gas_reactors) %>%\n",
    "  addProviderTiles(providers$CartoDB.Positron) %>%\n",
    "  addCircleMarkers(\n",
    "    ~Longitude, ~Latitude,  # Твои названия: Longitude, Latitude\n",
    "    \n",
    "    # Размер: (Макс возраст - Текущий возраст) / 2 + 4\n",
    "    # Чем моложе, тем больше точка.\n",
    "    radius = ~ (max(age) - age) / 2 + 4,\n",
    "    \n",
    "    color = \"#FF4500\", # Оранжевый\n",
    "    fillOpacity = 0.7,\n",
    "    stroke = FALSE,\n",
    "    \n",
    "    # Всплывающее окно\n",
    "    popup = ~paste0(\n",
    "      \"<b>Name:</b> \", Name, \"<br>\",\n",
    "      \"<b>Model:</b> \", ReactorModel, \"<br>\",\n",
    "      \"<b>Type:</b> \", ReactorType, \"<br>\",\n",
    "      \"<b>Age:</b> \", round(age, 1), \" years<br>\",\n",
    "      \"<b>Country:</b> \", Country\n",
    "    )\n",
    "  ) %>%\n",
    "  addControl(\"<h3>Газоохлаждаемые реакторы</h3>Size ∝ Youth (Bigger = Newer)\", position = \"topright\")"
   ]
  },
