   "source": [
    "library(tidyverse)\n",
    "library(leaflet)\n",
    "library(readr)\n",
    "\n",
    "df <- read_csv(\"/kaggle/input/architectural-offices-in-finland/Database.csv\")\n",
    "\n",
    "turku_offices <- df %>%\n",
    "  # 1. Текстовый фильтр \n",
    "  filter(str_detect(city, regex(\"Turku\", ignore_case = TRUE))) %>%\n",
    "  \n",
    "  # 2. ЧИСТКА ОТ ВЫБРОСОВ \n",
    "  filter(\n",
    "    latitude > 60.35 & latitude < 60.55,\n",
    "    longitude > 22.00 & longitude < 22.50\n",
    "  ) %>%\n",
    "  \n",
    "  # 3. Чистка прибыли\n",
    "  mutate(\n",
    "    op_profit_clean = str_remove_all(`operative profit`, \"[^0-9.-]\"),\n",
    "    op_profit_num = as.numeric(op_profit_clean),\n",
    "    final_profit = coalesce(op_profit_num, profit)\n",
    "  ) %>%\n",
    "  filter(!is.na(final_profit))\n",
    "\n",
    "# Визуализация \n",
    "pal <- colorNumeric(\n",
    "  palette = c(\"#D32F2F\", \"#FFEB3B\", \"#388E3C\"),\n",
    "  domain = turku_offices$final_profit\n",
    ")\n",
    "\n",
    "leaflet(turku_offices) %>%\n",
    "  addProviderTiles(providers$CartoDB.Positron) %>%\n",
    "  addCircleMarkers(\n",
    "    ~longitude, ~latitude,\n",
    "    radius = 7,\n",
    "    fillColor = ~pal(final_profit),\n",
    "    color = \"black\",\n",
    "    weight = 1,\n",
    "    fillOpacity = 0.8,\n",
    "    popup = ~paste0(\"<b>Name:</b> \", name, \"<br><b>Profit:</b> \", final_profit, \" €\")\n",
    "  ) %>%\n",
    "  addLegend(\"bottomright\", pal = pal, values = ~final_profit, title = \"Op. Profit (€)\", opacity = 1)\n"
   ]
  },
