   "source": [
    "library(tidyverse)\n",
    "library(rnaturalearth)\n",
    "library(rnaturalearthdata)\n",
    "library(sf)\n",
    "\n",
    "# 1. Загрузка\n",
    "df <- read.csv(\"/kaggle/input/global-data-gdp-life-expectancy-and-more/country_data.csv\") # <-- Проверь имя файла!\n",
    "\n",
    "# 2. Расчет индекса\n",
    "df_map <- df %>%\n",
    "  select(name, employment_services, employment_industry) %>% \n",
    "  mutate(\n",
    "    ratio = employment_services / (employment_industry + 0.1)\n",
    "  ) %>%\n",
    "  filter(!is.na(ratio))\n",
    "\n",
    "# 3. Карта мира\n",
    "world <- ne_countries(scale = \"medium\", returnclass = \"sf\")\n",
    "\n",
    "# 4. Объединение (Join)\n",
    "map_data <- world %>%\n",
    "  left_join(df_map, by = \"name\") \n",
    "\n",
    "# 5. Визуализация\n",
    "ggplot(data = map_data) +\n",
    "  geom_sf(aes(fill = ratio), color = \"white\", size = 0.1) +\n",
    "  \n",
    "  # Цветовая шкала\n",
    "  scale_fill_viridis_c(\n",
    "    option = \"plasma\", \n",
    "    name = \"Service/Industry Ratio\",\n",
    "    limits = c(0, quantile(df_map$ratio, 0.95, na.rm = TRUE)),\n",
    "    oob = scales::squish, \n",
    "    na.value = \"gray90\"\n",
    "  ) +\n",
    "  \n",
    "  labs(\n",
    "    title = \"Карта структурной занятости\",\n",
    "    subtitle = \"Отношение Услуги/промышленность\",\n",
    "    caption = \"Желтый = постиндустриальная экономика | Фиолетовый = индустриальная экономика\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    legend.position = \"bottom\",\n",
    "    plot.title = element_text(size = 16, face = \"bold\"),\n",
    "    legend.key.width = unit(2, \"cm\")\n",
    "  )\n"
   ]
  }
